// JOB CARD


const BoxStyle = (CompanyName, jobPostion, jobLocation, jobDescribion) => {
    return(
        <div className="w-full py-2 px-4 bg-[#f6f7fa]">
            <div className="max-w-[1240px] mx-auto grid md:grid-col-3 gap-10 bg-">
                <div className="border-2 border-gray-600 w-full shadow-xl  outline-2 flex flex-col p-4 rounded-lg ">
                    <h2 className="text-4xl font-bold text-left pb-auto">{jobPostion}</h2>
                    <h2 className="text-3xl font-bold text-left">{CompanyName}</h2>
                    <h2 className="text-2xl font-bold text-left">{jobLocation}</h2>
                    <p class="text-2 font-light">{jobDescribion}</p>
                </div>
            </div>                
        </div>
    )
}
export default BoxStyle
